          <span style={{ '--i': 6 }}>'</span>
          <span style={{ '--i': 7 }}>m&nbsp;</span>  {' '} 
          <span style={{ '--i': 8 }}>N</span>
          <span style={{ '--i': 9 }}>e</span>
          <span style={{ '--i': 10 }}>l</span>
          <span style={{ '--i': 11 }}>s</span>
          <span style={{ '--i': 12 }}>o</span>
          <span style={{ '--i': 13 }}>n</span>
        </div>
	);
}; // finding the nautre of this other person 

